sys_variable_value.value:
(function execute(inputs, outputs) {

  var url = gs.getProperty('x_1070098_my_eda_0.webhook_url');
  var token = gs.getProperty('x_1070098_my_eda_0.webhook_token');
  var mid_server = gs.getProperty('x_1070098_my_eda_0.mid_server');

  if (mid_server) {
    var mid = EdaEventMidServer();
    mid.send(mid_server, url, token, inputs.body);
  }
  else {
    var http = EdaEventDirect();
    http.send(url, token, inputs.body);
  }
})(inputs, outputs);

