sys_variable_value.value:
(function execute(inputs, outputs) {
  function viaMidServer(mid, url, token, event_body){
    /*
    var jspr = new JavascriptProbe(mid);
    jspr.setName('SendEdaWebhook'); //Any descriptive name will do
    jspr.setJavascript('var webhook = new EdaWebhookForward(); res = webhook.send();');
    jspr.addParameter('url', url);
    jspr.addParameter('token', token);
    jspr.addParameter("json_data", event_body);
    jspr.create();
    */
    if(event_body.startsWith('"')) {
      event_body = event_body.substring(1, event_body.length-1);
    }
    event_body = event_body.replaceAll('\\"', '&quot;');


    var urlParam = '<parameter name="url" value="' + url + '" />';
    var tokenParam = '<parameter name="token" value="' + token + '" />';
    var jsonParam = '<parameter name="json_data" value="' + event_body + '" />';

    var request = new GlideRecord("ecc_queue");
    request.initialize();
    request.name = "EDA Webhook";
    request.agent = "mid.server." + mid;
    request.payload = '<parameters><parameter name="script" value="var webhook = new EdaWebhookForward(); res = webhook.send();"/>' + urlParam + tokenParam + jsonParam + '</parameters>';
    request.queue = "output";
    request.topic = "JavascriptProbe";
	var request_id = request.insert();
    if (!request_id) {
      gs.error("REQUEST_ID is null");
      return;
    }

    /*
    var response_sysid;
    var response = new GlideRecord("ecc_queue");
    for (i = 0; true; i++){
      //gs.sleep(1000);
      response.addQuery("response_to", request_id);
      response.addQuery("queue", "input");
      response.query();
      if (response.next()) {
        gs.info("FINISH after " + i + "attempts. REPONSE from Mid Server: " + response.payload);
        break;
      }
    }
    */

  }

  function directSend(url, token, event_body){
    var req = new sn_ws.RESTMessageV2();
    req.setEndpoint(url);
    req.setHttpMethod("post");
    req.setRequestHeader("Authorization", "Bearer " + token);
    req.setRequestBody(body);
    var response = req.execute();
    var httpStatus = response.getStatusCode();
    gs.info("Webhook HTTP status response: " + httpStatus);
  }

  // main script
  var body = JSON.stringify(inputs.body);

  var url = gs.getProperty('x_1070098_my_eda_0.webhook_url');
  var token = gs.getProperty('x_1070098_my_eda_0.webhook_token');
  var mid_server = gs.getProperty('x_1070098_my_eda_0.mid_server');

  if (mid_server) {
    gs.info("Sending event " + body + " to EDA through mid server");
    viaMidServer(mid_server, url, token, body);
  }
  else {
    gs.info("Sending event " + body + " to EDA through direct webhook");
    directSend(url, token, body);
  }
})(inputs, outputs);

